    public String printLCS(int i, int j, String t1, String t2) {
        if (i == t1.length() || j == t2.length()) return "";
        if (memo[i][j] != -1) return printLCS(i+1, j+1, t1, t2) + text1.charAt(i) + text2.charAt(j);

        int res = 0;
        String lcs = "";
        if (t1.charAt(i) == t2.charAt(j)) {
            res = Math.max(res, printLCS(i+1, j+1, t1, t2) + 1);
            lcs = lcs + text1.charAt(i) + text2.charAt(j) + " ";
