    def on_message(client, userdata, msg):
        if msg.topic == 'internet-status':
            status = msg.payload.decode('utf-8')
            if status == 'connected':
                status_div = f"<div class='internet-status-static'>Internet is {status}</div>"
                return status_div
            else:
                status_div = f"<div class='internet-status-static'>{status}</div>"
                return status_div

