    client.connect("broker.hivemq.com", 1883, 60)
    client.subscribe("/internet-status")
    client.on_message = on_message

    try:
        client.loop_forever()
    except KeyboardInterrupt:
        pass

    client.disconnect()

    return render_template('internet_status.html')

if __name__ == '__main__':
    app.run()
```
