Higher Order Components (HOCs) are a feature of the React library that allow you to create reusable components by wrapping existing components with additional code.

HOCs are higher-order because they 'wrap around' or 'encapsulate' other components. They act like a decorator, adding functionality to the component they are wrapped around.

The idea behind HOCs is to extract common functionality out of a component, so that you don't have to duplicate code when you use that component in multiple parts of your application.

For example, let's say you have a component that displays a list of items, and you want to add a feature that allows users to filter the list based on certain criteria. You could create a HOC by wrapping your original component with additional code that implements the filtering functionality.

Here's a simple example of a HOC:
```jsx
import React from 'react';

const withFiltering = (WrappedComponent) => {
  return class extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        filter: ''
      };
    }

    handleFilterChange = (event) => {
      this.setState({ filter: event.target.value });
    };

    render() {
      return (
        <WrappedComponent
          filter={this.state.filter}
          onFilterChange={this.handleFilterChange}
        />
      );
    }
  };
};
```
