1. `HashSet`: A collection that implements the `Set` interface and uses a hash table to store the elements. Elements are inserted into the set using the `add()` method, and duplicates are automatically discarded.
```csharp
Set<String> set = new HashSet<>();
set.add("Apple");
set.add("Banana");
set.add("Apple");  // this will not modify the set, it only contains one "Apple"
```
2. `LinkedHashSet`: A collection that also implements the `Set` interface, but maintains the order in which elements are inserted into the set. It also uses a hash table to store the elements.
```sql
Set<String> set = new LinkedHashSet<>();
set.add("Apple");
set.add("Banana");
set.add("Apple");  // this will not modify the set, it only contains one "Apple"
```
3. `TreeSet`: A collection that implements the `SortedSet` interface and stores the elements in a red-black tree. By default, it sorts the elements in ascending order, and it also allows duplicate elements.
```sql
SortedSet<String> set = new TreeSet<>();
set.add("Apple");
set.add("Banana");
set.add("Apple");  // this will add "Apple" to the end of the set, creating a sorted set "Apple" -> "Banana"
