];

export default function App() {
  const [data, setData] = useState(MY_DATA);

  const keyExtractor = (item) => item.id;

  const handleUpdate = (id) => {
    const updatedItem = { ...MY_DATA[id], description: 'Updated ' + MY_DATA[id].description };
    setData(data.map((item) => (id === item.id ? updatedItem : item)));
  };

  return (
    <View>
      <FlatList
        data={data}
        renderItem={({ item }) => <Text>{item.name} - {item.description}</Text>}
        keyExtractor={keyExtractor}
      />
      <View style={{ marginTop: 20 }}>
        <Text onPress={() => handleUpdate(2)}>Update Item 2</Text>
      </View>
    </View>
  );
}
