def longest_overlapped_substring(s):
    if len(s) <= 1:
        return s

    start = 0
    end = len(s)
    max_length = 0
    max_substring = ""

    while end < len(s):
        while start < end:
            if s[start:end] in s[start:]:
                start += 1
            else:
                end = start + 1
        else:
            max_length = end - start + 1
            max_substring = s[start:end]
            break

    return max_substring
```
Here, the function takes a string as input and returns the longest substring overlapped in it. We start by setting `max_length` to 0 and `max_substring` to an empty string. We then initialize `start` and `end` to 0 and the length of the string, respectively. We also initialize `max_length` to 0.

We then enter a while loop that continues until we reach the end of the string. In each iteration of the loop, we check if the substring starting at `start` and ending at `end - 1` is present as a substring within itself. If it is, we increment `start` by 1. Otherwise, we set `end` to `start + 1` and reset `start`.

As long as there is a substring that overlaps itself, we find the substring with the longest length and return it with the length as the maximum length of an overlapped substring.

Finally, we return the `max_substring` variable that contains the longest overlapped substring found in the input string.

